import "./header.css"

export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleSm">React & Node</span>
        <span className="headerTitleLg">Blog</span>
        <img className="headerImg" src="https://in.images.search.yahoo.com/images/view;_ylt=Awr1TclZ67Nk3Eky6J69HAx.;_ylu=c2VjA3NyBHNsawNpbWcEb2lkAzMzODNkMTE3YmE2M2M3MzNmZDU0NDIzZjQ1NGI1ZWZlBGdwb3MDMQRpdANiaW5n?back=https%3A%2F%2Fin.images.search.yahoo.com%2Fsearch%2Fimages%3Fp%3Diiit%2Ballahabad%2Bimages%26fr%3Dcrmas%26fr2%3Dpiv-web%26tab%3Dorganic%26ri%3D1&w=700&h=525&imgurl=edupadhai.com%2Fwp-content%2Fuploads%2F2017%2F05%2Fiiit-allahabad-1.jpg&rurl=http%3A%2F%2Fedupadhai.com%2Fiiit-allahabad%2F&size=55.8KB&p=iiit+allahabad+images&oid=3383d117ba63c733fd54423f454b5efe&fr2=piv-web&fr=crmas&tt=IIIT+Allahabad+%7C+Cut+Off+%7C+Placements+%7C+Courses+%7C+Fee+Structure+%7C+Ranking&b=0&ni=21&no=1&ts=&tab=organic&sigr=03FGPH779pnK&sigb=tG2W_HY8eqWi&sigi=5qWjObK_5tWW&sigt=CmZyu8NR8E9Z&.crumb=R4e6aQ4nTVZ&fr=crmas&fr2=piv-web" alt="" />
      </div>
    </div>
  )
}
